import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../../App.css';
import backgroundImg from '../../assets/background.jpg';
import exampleImg from '../../assets/damon.jpg';
import {Navbar} from '../index';

const Profile = () => {
  return (
    <React.Fragment>
      <Navbar />
      <div>
        <img src={backgroundImg} alt="background" className="background-image" />
        <div className="container position-relative profile-position">
          <div className="d-flex align-items-end">
            <img src={exampleImg} alt="profile" className="profile-image border mr-4" />
            <div className="d-flex flex-column">
              <h4 className="mb-2">Damon Joung</h4>
              <span className="text-secondary mb-2">
                <small>5 Followers</small>
              </span>
            </div>
            <button className="btn btn-danger h-25 ml-auto px-2 py-1 mb-4">Follow</button>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
};

export default Profile;
